class Solution:
    def longestValidSubstring(self, word: str, forbidden: List[str]) -> int:
        forbidden_set = set(forbidden)
        if not forbidden_set:
            return len(word)
        max_len = max(len(f) for f in forbidden)
        current_start = 0
        max_length = 0
        n = len(word)

        for end in range(n):
            # Check all possible substrings ending at 'end' with lengths from 1 to max_len
            for l in range(1, max_len + 1):
                start_substring = end - l + 1
                if start_substring < 0:
                    continue
                if start_substring < current_start:
                    continue
                substring = word[start_substring:end+1]
                if substring in forbidden_set:
                    current_start = max(current_start, start_substring + 1)
            current_window_length = end - current_start + 1
            if current_window_length > max_length:
                max_length = current_window_length

        return max_length

